svg.script:
function activate(n){
    let myCircNum = document.getElementById(`circ-num-${n}`);
    let myCirc = document.getElementById(`circ${n}`);
    myCircNum.setAttribute('transform-origin',`${myCirc.getAttribute('cx')} ${myCirc.getAttribute('cy')}`);
    myCircNum.setAttribute('transform','scale(1.2)');



}
function deactivate(n){
    let myCircNum = document.getElementById(`circ-num-${n}`);
    myCircNum.setAttribute('transform','');
}
